import React, {useState, useEffect} from 'react';
import './App.css';
import { BrowserRouter as Router, Switch, Route, Link, Redirect } from 'react-router-dom';

const App = () => {


  return (
    <div className="App">
      <header className="App-header">
        Welcome to FlatTrackerPal
      </header>
      <Router>
        <Link className="pretty-link" to= "/login">Login</Link>
        <Link className="pretty-link" to= "/signup">Signup</Link>
        <Link className="pretty-link" to= "/logout">Logout</Link>
      </Router>
    </div>
  );
}

export default App;
